import React from "react";
import "../styles/header.module.css"; // Ensure you have this CSS file

const Header = () => {
  return (
    <header className="dashboard-header">
      <div className="left-section">
        {/* Menu Icon */}
        <i className="bx bx-menu menu-icon"></i>

        {/* Navigation Links */}
        <nav>
          <ul className="header-nav-links">
            <li><a href="#"><i class='bx bx-home'></i>Overview</a></li>
            <li><a href="#"><i class='bx bxs-time-five'></i>My Timestamps</a></li>
            <li><a href="#">Integrations</a></li>
            <li><a href="#">Automate & API</a></li>
          </ul>
        </nav>
      </div>

      <div className="right-section">
        {/* Start Free Trial Button */}
        <button className="trial-button">Start free Trial</button>

        {/* Notification Icon with Badge */}
        <div className="notification">
          <i className="bx bx-bell bell-icon"></i>
        </div>

        {/* User Dropdown */}
        <div className="user-dropdown">
          <span>user</span>
          <i className="bx bx-chevron-down chevron-down"></i>
        </div>
      </div>
    </header>
  );
};

export default Header;
